import React, {Component} from "react";
import $ from 'jquery';



class Cabecalho extends Component{
        render() {
            return(
                <div>

                    <nav className="navbar navbar-expand-md navbar-dark fixed-top bg-dark">
                        <a className="navbar-brand" href="#">Fixed navbar</a>
                        <button className="navbar-toggler" id="navbar" type="button" data-toggle="collapse"
                                data-target="#navbarCollapse" aria-controls="navbarCollapse" aria-expanded="false"
                                aria-label="Toggle navigation">
                            <span className="navbar-toggler-icon"></span>
                        </button>
                        <div className="collapse navbar-collapse" id="navbarCollapse">
                            <ul className="navbar-nav mr-auto">
                                <li className="nav-item active">
                                    <a className="nav-link" href="#">Home <span className="sr-only">(current)</span></a>
                                </li>
                                <li className="nav-item">
                                    <a className="nav-link" href="#">Link</a>
                                </li>
                                <li className="nav-item">
                                    <a className="nav-link disabled" href="#">Disabled</a>
                                </li>
                            </ul>
                            <form className="form-inline mt-2 mt-md-0">
                                <input className="form-control mr-sm-2" type="text" placeholder="Search"
                                       aria-label="Search"/>
                                    <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search
                                    </button>
                            </form>
                        </div>
                    </nav>
                </div>
            )
        }
}

var navbar_visible = $("#navbar").is(":visible");

$(window).resize(function(){
    navbar_visible = $("#navbar").is(":visible");

    if (navbar_visible)
        $('#brand_name').text('Navbar is visible');
    else
        $('#brand_name').text('Navbar is not visible');
});


export default Cabecalho;
